import React, { Component } from 'react';
import axios from "axios";
import {Link, Route, Switch} from "react-router-dom";
import ContactEmail from "./ContactEmail";
import ContactPhone from "./ContactPhone";



class StageThree extends Component {

    constructor(props){
        super(props);
        this.state={idVal:'' , linkUserId:'' , userData:{} ,  userAddress:[]}
    }

    /*static getDerivedStateFromProps(nextProps){
        return {idVal: nextProps.match.params.ID , linkUserId: nextProps.match.params.ID }
    }*/

    componentDidMount(){}

    componentDidUpdate(){
        return true;
    }

    back=()=>{
        console.log(this.props.history , 'rout history');
        this.props.history.push('/about');
    };

    render() {


        return (
            <div className="">
                <p>Chose City</p><br/>
                <list>

                </list>
                <Link to={`${this.props.match.url}/email`}>get our mail by this id</Link>
            </div>
        );
    }
}

export default StageThree;
